INSERT INTO `weiyi_news` VALUES('3','20','0','装修时哪些是不是节省的？','','http://localhost/wy/uploadfile/2016/0816/20160816104427130.jpg','装修时哪些是不是节省的？','装修是一个耗时又耗钱的工作，因此在选择装修材料上我们也是一省再省，巴不得全部都用最便宜的材料，只用一两万就装出一个房子。然而，装修   ','0','http://localhost/wy/meit/3.html','0','99','1','0','phpcms','1471338340','1471338364');
INSERT INTO `weiyi_news_data` VALUES('3','<span style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">装修是一个耗时又耗钱的工作，因此在选择装修材料上我们也是一省再省，巴不得全部都用最便宜的材料，只用一两万就装出一个房子。然而，装修和买房子一样，一旦选择了就不常再换新了，一般情况下装修一次会保持8年左右，具体的时间会根据所选择的材料来决定。<br style=\"padding: 0px; margin: 0px; list-style: none;\" />\r\n今天，和信居装饰小编也给大家带来一些选材上的知识。</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<ol style=\"padding-right: 0px; padding-left: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">\r\n<li style=\"padding: 0px; margin: 0px; list-style: none;\"><strong style=\"padding: 0px; margin: 0px; list-style: none;\">防水材料</strong></li>\r\n</ol>\r\n<span style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">&nbsp;&nbsp;&nbsp; 之所以把它放在第一位，是因为很多新装修的朋友都遇到这个问题。在我们的卫生间、厨房、阳台都会用到防水材料，我们遇到很多朋友都说前期没有把防水做好，后面又重新弄特别麻烦。为了防止卫生间和厨房渗水，大家一定要慎重选择。</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<ol style=\"padding-right: 0px; padding-left: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">\r\n<li style=\"padding: 0px; margin: 0px; list-style: none;\" value=\"2\"><strong style=\"padding: 0px; margin: 0px; list-style: none;\">主材材料</strong></li>\r\n</ol>\r\n<span style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">&nbsp;&nbsp;&nbsp;&nbsp; 装修用的主材上都会释放出一定的甲醛，材料越差甲醛越多，很多业主在装修的时候一味追求性价比，经常会忽略产品的环保系数，为了省钱，低于同类型产品环保标准的产品也买回家，这样不利于家人的身体健康，涉及到环保等健康的大问题时，钱是不能省的。</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<ol style=\"padding-right: 0px; padding-left: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">\r\n<li style=\"padding: 0px; margin: 0px; list-style: none;\" value=\"3\"><strong style=\"padding: 0px; margin: 0px; list-style: none;\">电气材料</strong></li>\r\n</ol>\r\n<span style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 这里面包含漏电保护器、导线、开关、插座、布线管等，现在电气与我们的生活息息相关，所有电线、辅料必须使用合格产品，所有插座、开关必须来自正规厂家，配电箱一定要安装漏电保护器，并由专业电工施工。</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<ol style=\"padding-right: 0px; padding-left: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">\r\n<li style=\"padding: 0px; margin: 0px; list-style: none;\" value=\"4\"><span style=\"padding: 0px; margin: 0px; list-style: none;\"><strong style=\"padding: 0px; margin: 0px; list-style: none;\">门窗材料</strong></span></li>\r\n</ol>\r\n<span style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 现在市面上有实木门和复合门，它们的费用有所不同，质量也有千差万别。其实门窗是衡量一个家舒适程度的重要指标，透过门和窗，我们和外界进行沟通，遮风挡雨、隔音隔热，开关顺畅，这些都会影响个人居住体验。<br style=\"padding: 0px; margin: 0px; list-style: none;\" />\r\n&nbsp;<br style=\"padding: 0px; margin: 0px; list-style: none;\" />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 以上就是&ldquo;装修时，哪些东西是最不能省的&rdquo;有关内容，相信大家在阅读了之后，也能够对其有所了解。在这里，和信居装饰也建议大家到正规的建材市场或者选择正规的装饰公司，挑选有知名度的品牌，不要为了贪一时的小便宜，而造成日后居家生活的不便。</span>','0','','0','10000','','0','','0','1','|0');
INSERT INTO `weiyi_news_data` VALUES('4','<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">前段时间，微博就曝出吉林某中学的学生集体甲醛中毒，近期，南昌某幼儿园的一百多名孩子出现发烧，咳嗽，流鼻血，全身皮疹、败血症等不同的症状。而这些事件都有同样的一个原因，那就是新房装修。</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">&nbsp;</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">众所周知，新房装修最大的污染就是甲醛污染，许多业主在装完房子之后都会放置3-4个月，然而油漆里面的二甲苯释放期是3个月，甲醛的释放期却是3至15年。&ldquo;放置三四个月，二甲苯几乎挥发了。但甲醛仍然存在，不可掉以轻心。&rdquo;和信居装饰从事装修十余年的工长经理告诉我们。</span><br />\r\n<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">那么如何避免甲醛的污染呢？除了我们大家常见的开窗通风、养殖植物和活性炭法之外，我们最重要的是要从源头上解决。不论是在油漆的选择上还是家具的购买上，都要避免用到甲醛含量高的产品。</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">&nbsp;</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">和信居装饰在为业主装修房屋所选用的主材上，就采用了环保系数高、甲醛量小的品牌，比如蒙娜丽莎地砖、莱茵春天木地板、帝王洁具、方太烟机灶具等，在业主能够承受价额的情况下又能够确保用材的品质，这无疑是给了成都需要装修的业主一个好选择。</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">&nbsp;</span><br style=\"padding: 0px; margin: 0px; list-style: none; font-size: 14px; font-family: 微软雅黑; color: rgb(102, 102, 102); line-height: 30px;\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">在这里也要提醒广大要装修的业主们，新房装修是关乎到我们未来生活质量的一项大工程，一定要慎重选择，不能为了贪图便宜直接找游击队装修，选择一家正规有保障的装修公司，不仅能够保证装修质量，绿色装修，还可以整装全包，装修所用主材辅材、家具家电都可以一站式全搞定，业主直接拎包入住即可。</span>','0','','0','10000','','0','','0','1','|0');
INSERT INTO `weiyi_page` VALUES('15','公司简介',';','公司简介','&nbsp; &nbsp; &nbsp;成都唯意装饰工程有限公司成立于2016年，本着&ldquo;客户的满意是我们成功的唯一标准&rdquo;的经营理念，打造一站式整装服务品牌。公司具有上千平材料展厅，集设计、材料、施工、家具、家电等于一体，真正做到让客户&ldquo;省时、省钱、省心&rdquo;。<br />\r\n&nbsp;<br />\r\n公司内部设有高档而优雅的交流品鉴区、内容丰富的品牌材料展示区、风格各异的情景样板间模拟区、琳琅满目的软装饰品区、品种齐全的家具家电展示区、舒适宽敞的办公环境区，是一家综合性家装装饰企业。<br />\r\n&nbsp;<br />\r\n唯意装饰现拥有员工400余名，其中包括60多位经验丰富的项目经理组成的工程管理队伍，200多位技术精良的施工队伍。现公司设计团队分为四大设计团队，一对一贴身为客户打造高标准的设计方案，免费量房，免费设计，客户对方案满意为止。<br />\r\n在持续的不断创新探索中，唯意装饰形成了一套完整的家装服务链，从先进环保的德标工程体系，自营仓运、72小时售后，到独立质检和金牌施工体系，让唯意装饰在成都市家装行业奠定了坚实的基础!<br />\r\n&nbsp;<br />\r\n唯意装饰作为互联网+装饰企业，致力于打造高性价比的一站式整体家装，为客户打造一流品质的舒适家居环境，在&ldquo;客户的满意是我们成功的唯一标准&rdquo;的道路上，我们不断前行！<br />\r\n','','0');
INSERT INTO `weiyi_page` VALUES('16','服务承诺',';','','<strong>唯意装饰8大承诺</strong><br />\r\n<br />\r\n一、费用清晰透明，0增项，增一赔十；<br />\r\n&nbsp;<br />\r\n二、免费量房，免费设计，免费出预算，满意后再合；<br />\r\n&nbsp;<br />\r\n三、自有产业工人施工，专业监理团队监管；<br />\r\n&nbsp;<br />\r\n四、工程和材料 ，客户当面验收合格签字后才可施工；<br />\r\n<br />\r\n五、真材实料，假一赔十。杜绝以次充好、偷工减料；<br />\r\n&nbsp;<br />\r\n六、按合同约定时间完工，工期无故延误，公司承担全责并赔偿；<br />\r\n<br />\r\n七、工程质量达到国家质量评定标准，不达标不满意，我们马上砸掉重做；<br />\r\n八、装饰装修主材质保为15年，厨房、卫生间防渗漏工程保修期为8年。<br />\r\n&nbsp;<br />\r\n注：以上承诺均已写入正式合同，合同签订即生效。<br />\r\n','','0');
